import React, { Component } from 'react';
import CardList from './CardList';
import { Robots } from './Robots';
import SearchBox from './SearchBox';


class App extends Component {
    constructor() {
        super()
        this.state = {
            Robots: Robots,
            searchField: ''
        }
    }
    render() {
        return (
            <div className='tc'>
            <h1>RoboFriends</h1>
            <SearchBox />
            <CardList Robots={this.state.Robots} />
            </div>
            );
    }

}

export default App;
